<font SIZE="10"/>
<node TEXT="// @ExecutionModes({on_single_node=&quot;main_menu_scripting/studyPlanner[addons.newActivity]&quot;})&#xa;import javax.swing.*;&#xa;import groovy.swing.SwingBuilder&#xa;import java.awt.FlowLayout as FL&#xa;import javax.swing.BoxLayout as BXL&#xa;&#xa;def defaultTypes = [&apos;Homework&apos;, &apos;Learning&apos;, &apos;Repetition&apos;,  &apos;Reading&apos;, &apos;Practical work&apos;, &apos;Test preparation&apos;, &apos;Poster&apos;]&#xa;&#xa;def s = new SwingBuilder()&#xa;def vars = s.variables&#xa;def dial = s.dialog(title:&apos;Activity description&apos;, minimumSize: [300, 50],&#xa;modal:true, locationRelativeTo:ui.frame, owner:ui.frame, defaultCloseOperation:JFrame.DISPOSE_ON_CLOSE, pack:true) {&#xa;    panel(){&#xa;        boxLayout(axis:BXL.Y_AXIS)&#xa;&#xa;        panel(alignmentX:0f) {&#xa;            flowLayout(alignment:FL.LEFT)&#xa;            label(&apos;Activity description&apos;)&#xa;            textField(id:&apos;description&apos;, columns:25)&#xa;        }&#xa;        panel(alignmentX:0f) {&#xa;            flowLayout(alignment:FL.LEFT)&#xa;            label(&apos;Start time [HH:mm]&apos;)&#xa;            textField(id:&apos;start&apos;, columns:25)&#xa;        }&#xa;        panel(alignmentX:0f) {&#xa;            flowLayout(alignment:FL.LEFT)&#xa;            label(&apos;End time [HH:mm]&apos;)&#xa;            textField(id:&apos;end&apos;, columns:25)&#xa;        }&#xa;&#xa;        panel(alignmentX:0f) {&#xa;            flowLayout(alignment:FL.LEFT)&#xa;            label(&apos;Type&apos;)&#xa;            comboBox(id:&apos;type&apos;, editable:true, items:defaultTypes)&#xa;        }&#xa;        panel(alignmentX:0f) {&#xa;            flowLayout(alignment:FL.RIGHT)&#xa;            button(action: action(name: &apos;OK&apos;, defaultButton: true, mnemonic: &apos;O&apos;,&#xa;                    closure: {vars.ok = true; dispose()}), enabled:{vars.start.text.matches(&apos;[0-2][0-4]:[0-5][0-5]&apos;)})&#xa;            button(action: action(name: &apos;Cancel&apos;, mnemonic: &apos;C&apos;, closure: {dispose()}))&#xa;        }&#xa;    }&#xa;}&#xa;&#xa;ui.addEscapeActionToDialog(dial)&#xa;dial.visible = true&#xa;&#xa;if (vars.ok){&#xa;    def child = node.createChild()&#xa;    child.text = vars.description.text&#xa;    child[&apos;Subject&apos;] = node.text&#xa;    child[&quot;Type&quot;] = vars.type.selectedItem&#xa;    //&#x9;child.attributes.set(&quot;Type&quot;,oT.textArea4.text)&#xa;    child.attributes.set(&quot;Start&quot;,format(parse(vars.start.text), &quot;HH:mm&quot;))&#xa;    child.attributes.set(&quot;End&quot;,format(parse(vars.end.text), &quot;HH:mm&quot;))&#xa;    child[&apos;Duration&apos;]=&quot;= node[&apos;End&apos;].calendar.get(Calendar.HOUR_OF_DAY) * 60 + node[&apos;End&apos;].calendar.get(Calendar.MINUTE) - node[&apos;Start&apos;].calendar.get(Calendar.HOUR_OF_DAY) * 60 - node[&apos;Start&apos;].calendar.get(Calendar.MINUTE)&quot;&#xa;    child[&apos;Period&apos;]=&quot;=&apos;from &apos;+node.attributes.getFirst(&apos;Start&apos;)+&apos; to &apos;+node.attributes.getFirst(&apos;End&apos;)&quot;&#xa;    child.icons.add(&apos;Study Icons/Settings/Activity&apos;)&#xa;}&#xa;" ID="ID_1840638909" CREATED="1369653446139" MODIFIED="1369653446164"/>
</node>
<node TEXT="countdownActivity.groovy" FOLDED="true" ID="ID_1633171978" CREATED="1329686175397" MODIFIED="1334912082151">
<attribute_layout NAME_WIDTH="253" VALUE_WIDTH="253"/>
<attribute NAME="menuTitleKey" VALUE="addons.countdownActivity"/>
<attribute NAME="menuLocation" VALUE="main_menu_scripting/studyPlanner"/>
<attribute NAME="executionMode" VALUE="on_single_node"/>
<attribute NAME="keyboardShortcut" VALUE="F4"/>
<attribute NAME="execute_scripts_without_asking" VALUE="true"/>
<attribute NAME="execute_scripts_without_file_restriction" VALUE="true"/>
<attribute NAME="execute_scripts_without_write_restriction" VALUE="true"/>
<attribute NAME="execute_scripts_without_exec_restriction" VALUE="false"/>
<attribute NAME="execute_scripts_without_network_restriction" VALUE="false"/>
<font SIZE="10"/>
<node TEXT="// @ExecutionModes({on_single_node=&quot;main_menu_scripting/studyPlanner[addons.countdownActivity]&quot;})&#xa;&#xa;import groovy.swing.SwingBuilder&#xa;import java.awt.FlowLayout as FL&#xa;import javax.swing.BoxLayout as BXL&#xa;import javax.swing.JFrame&#xa;import groovy.beans.Bindable&#xa;import java.util.timer.*  &#xa;import java.applet.Applet;&#xa;import java.applet.AudioClip;&#xa;import java.io.File&#xa;//import java.awt.event.WindowEvent;&#xa;&#xa;/*&#xa; To encourage focusing on doing concrete tasks, and accumulate Pomodoro credits, this script provides a Pomodoro timer against a node in mind-map. &#xa; When the time reaches the break time, plays sound of applause for encouragement, &#xa; and when the time is up, add the time Pomodoro time credit to the current node&apos;s attribute with the name of &apos;Pomodoro&apos;, &#xa; and add to the root node&apos;s attribute with name of today&apos;s date. &#xa;&#xa; Need to customize the path to the audio file &quot;nsmb_power-up.WAV&quot; in function playSound&#xa;&#xa; Developed by Yu Shen based on examples of SwingBuilder in Freeplane Forum, and other examples of timer tasks, and @Bindable found in Internet&#xa; 2012-01-01&#xa;*/&#xa;&#xa;class PlaySound {&#xa;&#x9;String s //system file separator (; or : )&#xa;&#x9;String ps //system path separator (/ or \)&#xa;&#x9;String scriptFolders //user defined folders for scripts from the freeplane properties panel&#xa;&#x9;String[] scriptFoldersArray //array of folders where user&apos;s scripts can be found&#xa;&#x9;File soundFileName //complete filename of the sound file&#xa;&#x9;String tempSoundFileName//working string for  finding the sound file&#xa;&#x9;String userPath //path of the freeplane user&apos;s directory&#xa;&#x9;&#xa;&#x9;PlaySound (String scriptFolders, String userPath) {&#xa;&#x9;  s = File.separator&#xa;    ps = File.pathSeparator&#xa;    this.scriptFolders = scriptFolders&#xa;    this.userPath = userPath&#xa;    scriptFoldersArray = scriptFolders.split(ps); //list of directories where script could live&#xa;    tempSoundFileName = &quot;&quot;;&#xa;    soundFileName = null;&#xa;&#x9;}&#xa;&#x9;&#xa;&#x9;public void play(String fileName) {&#xa;&#x9;&#x9;if (fileName == &quot;&quot;) {&#xa;&#x9;&#x9;&#x9;fileName = &quot;nsmb_power-up.wav&quot;; //default sound file&#xa;&#x9;&#x9;}&#xa;&#x9;&#x9;&#xa;&#x9;&#x9;//absolute sound file name &#xa;&#x9;&#x9;File tempFileName = new File(fileName)&#xa;&#x9;&#x9;if (tempFileName.isAbsolute()) {&#xa;&#x9;&#x9;&#x9;soundFileName = tempFileName&#xa;&#x9;&#x9;}&#xa;&#x9;&#x9;&#xa;&#x9;&#x9;//relative sound file name&#xa;&#x9;&#x9;//looking for the base directory from user&apos;s preferences&#xa;&#x9;&#x9;if (soundFileName == null) {&#xa;&#x9;    for (String item : scriptFoldersArray) {&#xa;&#x9;    &#x9;  File tempSoundFile = new File(item)&#xa;&#x9;    &#x9;  if (tempSoundFile.isAbsolute()) {&#xa;&#x9;    &#x9;  &#x9; tempSoundFileName = item + s + fileName&#xa;&#x9;    &#x9;  } else {&#xa;&#x9;    &#x9;  &#x9; tempSoundFileName = userPath + s + item +s +fileName&#xa;&#x9;    &#x9;}&#xa;&#x9;    &#x9;&#x9;tempSoundFile = new File(tempSoundFileName)&#xa;&#x9;    &#x9;&#x9;&#xa;&#x9;    &#x9;&#x9;if(tempSoundFile.exists()) {&#xa;&#x9;    &#x9;&#x9;&#x9;soundFileName = tempSoundFile&#xa;&#x9;   &#x9;&#x9;}&#xa;&#x9;    }&#xa;&#x9;  }&#xa;    if (soundFileName != null) {&#xa;    &#x9;AudioClip sound = Applet.newAudioClip(soundFileName.toURL());&#xa;    &#x9;sound.play();&#xa;    }&#xa;&#x9;}&#xa;}&#xa;&#xa;class CountDown { // resolution: second&#xa;  int delay = 1 // seconds&#xa;  int period = 1 // seconds&#xa;  int countDownValue // seconds, the total value of the countDown, per Pomodoro Techniques: http://www.pomodorotechnique.com/&#xa;  int remainingTime // seconds, multiple of 60 (for minute)&#xa;  int breakTime// seconds, time for break&#xa;  def userPath //freeplane user path&#xa;  boolean running = true&#xa;  def node&#xa;  def c&#xa;  def scriptFolders&#xa;  TimerTaskCountDown task&#xa;  Timer timer&#xa;&#x9;def myWindow //the displayed window&#xa;&#x9;def dial&#xa;&#x9;&#xa;&#x9;&#xa;  CountDown (nodeIn, controller, scriptFolders) { &#xa;    this.node = nodeIn&#xa;    this.c = controller&#xa;    this.scriptFolders = scriptFolders&#xa;        &#xa;    task = new TimerTaskCountDown(this)&#xa;    timer =  new Timer()&#xa;    timer.schedule(task, delay*1000, period*1000)&#xa;  &#xa;    countDownValue = nodeIn[&apos;Duration&apos;].to.num0 * 60&#xa; //   countDownValue = 2&#xa;    (countDownValue &gt; 0) ? countDownValue : 25*60&#xa;    remainingTime = countDownValue&#xa;    breakTime = 0&#xa;    timeStr = secondToString(countDownValue)&#xa;&#xa;    userPath = c.userDirectory.toString();&#xa;    showWindow()&#xa;  }&#xa;  &#xa;  // adaptive display for count down time, and available operation&#xa;  @Bindable String timeStr = &quot;&quot;&#xa;  @Bindable String buttonName = &apos;Pause&apos;&#xa;&#xa;  public int getElapsedTime () {&#xa;    return ((countDownValue - remainingTime)/60).toInteger() // convert to minutes&#xa;  }&#xa;&#xa;  def getValue(node, attrib) {// get valid attribute value&#xa;    def value = node.getAttributes().getFirst(attrib)&#xa;    (value != null) ? value.toInteger() : 0&#xa;  }&#xa;&#xa;void accumulateTime () { // add Pomodoro credit against current node and the root node for today&apos;s attribute&#xa;    int elapseTime =  getElapsedTime()&#xa;    if (elapseTime &gt;= 0) {&#xa;      node[&apos;Pomodoro&apos;] = elapseTime.toInteger()&#xa;      def today = new Date()&#xa;      def formattedDate = today.format(&apos;yyyy-MM-dd&apos;)&#xa;      def rootNode = node.map.root&#xa;      rootNode[formattedDate] = elapseTime.toInteger()&#xa;    }&#xa;  } &#xa;&#xa;  public String secondToString(x) {&#xa;    int seconds = x % 60 ;&#xa;    int minutes =(int) (x / 60);&#xa;    return String.format(&quot;%02d:%02d&quot;, minutes, seconds)&#xa;  }&#xa;&#xa;  public start() {&#xa;    // println &quot;Start&quot;&#xa;    //remaningTime = countDownValue&#xa;    running = true&#xa;    // no cancel, thus no restart&#xa;    // timer =  new Timer()&#xa;    // task = new TimerTaskCountDown(this)&#xa;    // timer.schedule(task, delay*1000, period*1000)&#xa;    setButtonName(&apos;Pause&apos;)&#xa;  }&#xa;&#xa;  void end () {&#xa;&#x9;//accumulateTime ()&#xa;     // it would be more saving of CPU, slightly, to cancel the timer, and tasks. &#xa;    // But my experiment didn&apos;t work. It caused the Swing Widget disappear. I&apos;m not sure why. &#xa;    //task.cancel()&#xa;    //timer.cancel()&#xa;    setButtonName(&apos;Start&apos;);&#xa;    running = false&#xa;  }&#xa;&#xa;  void playSound () {&#xa;    PlaySound ps = new PlaySound(scriptFolders, userPath)&#xa;    ps.play(&quot;pomodoro.wav&quot;)&#xa;  }&#xa;  &#xa;  public void update() {// for timer task&#xa;    if (running) {&#xa;      if (remainingTime &gt;= period) {&#xa;        remainingTime -= period&#xa;      } else { &#xa;        end()&#xa;      }&#xa;      setTimeStr(secondToString(remainingTime))&#xa; &#xa;       if (remainingTime == breakTime) { // play sound to congratulate&#xa;&#x9;&#x9;node.icons.remove(&apos;Study Icons/Settings/Activity&apos;)&#xa;&#x9;&#x9;node.icons.add(&apos;Study Icons/Settings/Done&apos;)&#xa;        playSound ()&#xa;        task.cancel()&#xa;        timer.cancel()&#xa;        myWindow.dispose()&#xa;      }&#xa;    }&#xa;  }&#xa;&#xa;  public void react () {&#xa;    if (running) {// pause&#xa;      end ();&#xa;    } else {// start&#xa;      start()}&#xa;  }&#xa;  &#xa;  public void showWindow() {&#xa;  &#x9;myWindow = new MyWindow(this, node)&#xa;  &#x9;myWindow.buildWindow()&#xa; }&#xa; &#xa;} //class&#xa;&#xa;class TimerTaskCountDown extends TimerTask {&#xa;  CountDown model&#xa;&#xa;  public TimerTaskCountDown (CountDown model) {&#xa;    // super() // not neccessary&#xa;    this.model = model&#xa;  }&#xa;&#xa;  public void run() {&#xa;    model.update()&#xa;  }  &#xa;}  &#xa;&#xa;&#xa;&#xa;class MyWindow extends SwingBuilder {&#xa;&#x9;CountDown model&#xa;&#x9;def node&#xa;&#xa;&#x9;MyWindow(model, node) {&#xa;&#x9;&#x9;super(SwingBuilder)&#xa;&#x9;&#x9;this.model = model&#xa;&#x9;&#x9;this.node = node&#xa;&#x9;}&#xa;&#x9;&#xa;&#x9;void bye() {&#xa;&#x9;&#x9;&#x9;//this.dispose()&#xa;&#x9;&#x9;&#xa;&#x9;&#x9;&#x9;&#xa;&#x9;}&#xa;&#x9;&#xa;&#x9;public void buildWindow() {&#xa;&#x9;this.dialog(title:&apos;Countdown Activity&apos;, id:&apos;pormodoro&apos;, modal:false,  defaultCloseOperation:JFrame.DISPOSE_ON_CLOSE, pack:true, show:true, alwaysOnTop:true) {&#xa;  &#x9;panel() {&#xa;    &#x9;boxLayout(axis:BXL.Y_AXIS)&#xa;    &#x9;panel(alignmentX:0f) {&#xa;     &#x9; flowLayout(alignment:FL.LEFT)&#xa;     &#x9; label text: node.text + &apos;: &apos;&#xa;     &#x9; label text: bind {model.timeStr}&#xa;    &#x9;}&#xa;&#xa;   &#x9; panel(alignmentX:0f) {&#xa;   &#x9;   flowLayout(alignment:FL.RIGHT)&#xa;   &#x9;   button (text: bind {model.buttonName}, actionPerformed: {model.react(); }) &#xa;   &#x9; }&#xa;  &#x9;}&#xa;&#x9;}&#x9;&#xa;&#x9;}&#xa;&#x9;&#xa;}&#xa;&#xa;def void byebye(model, myWindow) {&#xa;&#x9;if (model.remainingTime == 0) {&#xa;&#x9;&#x9;myWindow.bye()&#xa;&#x9;}&#xa;}&#xa;&#xa;//script main&#xa;&#xa;//user&apos;s script preferences&#xa;def scriptFolders = config.getProperty(&apos;script_directories&apos;)&#xa;if (node[&apos;Duration&apos;].to.num0 &gt; 0) {&#xa;&#x9;CountDown model = new CountDown(node, c, scriptFolders)&#xa;} else&#xa;{&#xa;&#x9;ui.informationMessage(&quot;Please select a node with activity.&quot;);&#xa;}&#xa;" ID="ID_874273620" CREATED="1369653446169" MODIFIED="1369653446180"/>
</node>
